import {makeAutoObservable} from "mobx";

type Position = 'top' | 'center'| 'bottom'
export default class NavStore {
  constructor() {
    makeAutoObservable(this);
  }

  navPosition : Position = 'center'

  handleNavPositon(pos : Position){
    this.navPosition = pos
  }


}
